					'Content-Type':'application/json'
				},
				body: JSON.stringify({username:email,password})
			})
			const data = await responce.json()

			if(responce.status === 200){
				history("/loginPage")
				alert(data.message)
			}else{
				alert(data.message)
			}

		}catch(err){
			alert(err)
			console.log(err);
		}

    }
    return(
        <Form
            title="register"
            handleClick={handleRegister}
        />
    )
}
